import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(() => ({
  link: {
    display: 'flex',
    width: '100%',
    height: '100%',
    padding: '13px 17px',
    cursor: 'pointer',
  },
}));

export default useStyles;
